import React from "react";
import { styled } from "@mui/system";

const Wrapper = styled("div")({
  display: "flex",
  flexDirection: "row",
  backgroundColor: "azure",
  height: "calc(100vh - 107px)",
  position: "relative",
  borderRadius: "40px",
});
const Organizations = () => {
  return <Wrapper></Wrapper>;
};

export default Organizations;
